import React, {useContext, useEffect} from "react"
import EmployeeFinder from "../api/EmployeeFinder"
import { EmployeeContext } from "../context/EmployeeContext"

const EmployeeList = (props) => {
  const {Employee, setEmployee} = useContext(EmployeeContext)
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await EmployeeFinder.get("/");  // This hits "http://localhost:4700/employee/"
        if (response && response.data) {
          setEmployee(response.data); // Assuming the server just returns an array
        }
      } catch (err) {
        console.error("Failed to fetch employee data:", err);
      }
    };
    fetchData();
  }, [setEmployee])  // Dependency array is correct now


  return (
    <div className="container">
      <table className="table table-hover">
        <thead>
          <tr className="table-active">
            <th scope="col">Employee ID</th>
            <th scope="col">Employee Name</th>
            <th scope="col">Start Date</th>
            <th scope="col">Employee Email</th>
            <th scope="col">Manager ID</th>
            <th scope="col">Branch ID</th>
          </tr>
        </thead>
        <tbody>
        {employee.map((employeeItem) => (  // Ensure 'employee' is an array
          <tr key={employeeItem.employee_id}>
            <td>{employeeItem.employee_name}</td>
            <td>{employeeItem.start_date}</td>
            <td>{employeeItem.employee_email}</td>
            <td>{employeeItem.manager_id}</td>
            <td>{employeeItem.branch_id}</td>
          </tr>
        ))}
        </tbody>
      </table>
    </div>
  );
}

export default EmployeeList
